//Raycasting 
const raycaster = new THREE.Raycaster();
const mouse = new THREE.Vector2();

function onDocumentMouseDown( event ) {
  
  mesh.visible = true;
  render();
}
function onDocumentMouseUp( event ) {

	mesh.visible = false;
	

}
var Firstintersect;

function render() {

	// update the picking ray with the camera and mouse position
  
	raycaster.setFromCamera( mouse, camera );

	// calculate objects intersecting the picking ray
	var intersects = raycaster.intersectObjects(AgentsGroup.children,true);



  Firstintersect = intersects[0];
  console.log(Firstintersect);

  intersects[0].object.scale.set(intersects[0].object.scale.x - 0.5,intersects[0].object.scale.y - 0.5,intersects[0].object.scale.z - 0.5);

  

BulletMove = true;
Bulletmesh.position.set(mesh.position.x,mesh.position.y,mesh.position.z);

  



	renderer.render( scene, camera );

}

// when the mouse moves, call the given function
